import React from 'react'
import GlobleStyle from './GlobleStyle';
import Header from './/Header';
import Advanced from './/Advanced_Services';
import AppTesting from './/App_testing_service';
import Project from './/OurProjext';
import Contact from './/contact';
import Footer from '.t/Footer';


export default function home() {
    return (
        <div> 
            < GlobleStyle />
            < Header />
            < Advanced />
            < AppTesting />
            < Project />
            < Contact />
            < Footer />
        </div>
    )
}
